import navbar from './Nav.module.css';
import {NavLink} from 'react-router-dom';
const Nav = () => {
    return (
        <nav className={navbar.sidebar}>
            <div> <NavLink className = { navData => navData.isActive ? navbar.active : navbar.sidebar } to="/profile">Profile</NavLink> </div>
            <div> <NavLink className = { navData => navData.isActive ? navbar.active : navbar.sidebar } to="/dialogs">Dialogs</NavLink> </div>
            <div> <NavLink className = { navData => navData.isActive ? navbar.active : navbar.sidebar } to="/">Music</NavLink> </div>
            <div> <NavLink className = { navData => navData.isActive ? navbar.active : navbar.sidebar } to="/">Post</NavLink> </div>
            <div> <NavLink className = { navData => navData.isActive ? navbar.active : navbar.sidebar } className={navbar.sidebar_setting} to="#" >Setting</NavLink> </div>
        </nav>
    );
}

export default Nav;
